export class Test2 extends Component {
    state ={

        value1 : 'Defalt'

    }

    change =(event) =>{

        this.setState({
            value1: event.target.value,

        })
    }

    render() {
        return (
            <div>


                <input type="text" value={this.state.value1} onChange={this.change}/>
                <input type="submit"/>

                <p> </p>
            </div>
        )
    }
}

export default Test2
